import LaptopImg from "../images/computer-1185626_1280.jpg";

const RegisterAd = () => {
  return (
    <div
      style={{ width: "700px" }}
      className="register-ad-container ml-20 mt-8 text-slate-50 bg-amber-600 rounded-lg flex justify-between 	"
    >
      <div className="take-back-section ml-2 pt-2">
        <h1 className="font-serif font-bold text-4xl">
          Take Back What's Yours
        </h1>
        <p className="mt-2">
          File your taxes with us today by scheduling a session with one of our
          tax professionals.
        </p>
        <button className="bg-sky-600 mt-4 text-lg pt-2 pb-2 pl-4 pr-4 rounded">
          Register <strong>Now</strong>
        </button>
      </div>
      <img
        className="rounded-l-none rounded-lg	"
        width="300px"
        src={LaptopImg}
        alt="img"
      />
    </div>
  );
};
export default RegisterAd;
